import {
  StyleSheet,
  Text,
  View,
  ImageBackground,
  SafeAreaView,
  Button,
  TouchableOpacity
} from "react-native";
import React from "react";

export default function ProfileScreen() {
  return (
    <View style={styles.container}>
      <ImageBackground
        source={require("../../assets/media/myappbg.png")}
        style={styles.backgroundImage}
      >
        <SafeAreaView style={styles.loginContainer}>
          <Text style={styles.headerText}>Welcome To Gruvii</Text>
          <Button title="Log In" color="#13997c" />
          <TouchableOpacity
            style={{ backgroundColor: "#13997c", color: "#fff", width: 50 }}
            onPress={() => navigate("HomeScreen")}
            underlayColor="#fff"
          >
            <Text style={styles.buttonsText}>Sign Up</Text>
          </TouchableOpacity>
        </SafeAreaView>
      </ImageBackground>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    width: "100%",
    backgroundColor: "transparent",
    alignItems: "center",
    justifyContent: "center"
  },
  backgroundImage: {
    height: "100%",
    width: "100%",
    alignItems: "center",
    justifyContent: "center"
  },
  loginContainer: {
    alignItems: "center",
    justifyContent: "center",
    backgroundColor: "rgba(255,255,255,.9)",
    height: "60%",
    width: "75%"
  },
  headerText: {
    fontSize: 25,
    paddingTop: Platform.OS === "ios" ? 20 : 20,
    paddingBottom: 20,
    color: "black"
  },
  buttonsText: {
    color: "#fff"
  }
});
